import React from 'react';



const Display = () => {
    return(
        <div style="width: 200px;
        height: 200px;
        border: 1px solid #bbbb;
    }">
            <h1>
                name:jack
            </h1>
            <h2>
                age:35
            </h2>
            <h3>
                job:dev
            </h3>
        </div>
    );
}

export default Display;
